import React from "react";
import styled from "styled-components";

const Header = () => {
    return (
        <Container>
            <Logo>
                <img src="./images/logo.svg" alt="" />
            </Logo>
            <Nav>
                <p>
                    <a href="#">Model S</a>
                </p>
                <p>
                    <a href="#">Model X</a>
                </p>
                <p>
                    <a href="#">Model 3</a>
                </p>
                <p>
                    <a href="#">Model Y</a>
                </p>
                <p>
                    <a href="#">Solar Panels</a>
                </p>
                <p>
                    <a href="#">Solar Roof</a>
                </p>
            </Nav>
        </Container>
    );
};

export default Header;

const Container = styled.div`
    min-height: 60px;
    position: fixed;
    display: flex;
    align-items: center;
    padding: 0 20px;
`;

const Logo = styled.div``;

const Nav = styled.div`
    display: flex;
    align-items: center;
    flex: 1;

    p {
        font-weight: 600px;
        text-transform: uppercase;
        padding: 0 10px;
        flex-wrap: nowrap;
    }
`;
